script: |
  super -f text -I q731.spq | sort > q731.out

inputs:
  - name: q731.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col1 * + col1 BETWEEN + - 47 + + + col2 AND - - col2;
  - name: tab2

outputs:
  - name: q731.out
    data: |
      46	51	23
      64	77	40
      75	67	58
